import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const Wrapper = styled.div`
  label {
    font-weight: 500;
  }
`;

function PlacesPage() {
  return (
    <Wrapper className="container">
      <h3>Accommodation</h3>
      <Link to="/account" className="btn btn-primary my-2">
        &plus, Add new place
      </Link>
      <div>
        <form onSubmit="">
          <label className="form-label my-2">Title</label>
          <p className="text-secondary">your title should be short</p>
          <input
            type="text"
            name="title"
            className="form-control"
            // value={values.name}
            // onChange={handleChange}
            placeholder="title"
          />
          <label className="form-label my-2">Address</label>
          <p className="text-secondary">address to this place</p>
          <input
            type="text"
            name="address"
            className="form-control"
            // value={values.email}
            // onChange={handleChange}
            placeholder="address"
          />
          <label className="form-label my-2">Photos</label>
          <p className="text-secondary">the more = better</p>
          <button
            type="file"
            name="photos"
            className="form-control"
            // value={values.password}
            // onChange={handleChange}
            placeholder="photos"
          ></button>

          <button className="btn btn-primary my-2" type="submit">
            Submit
          </button>
        </form>
      </div>
    </Wrapper>
  );
}

export default PlacesPage;
